import React from "react";

import { fetchAPI } from "../../lib/api";

const Landingpage = ({ articles, categories, homepage, global, writers }) => {

  <h1>Welcome to landingpage!</h1>
}
const seo = {
  metaTitle: landingpage,
  metaDescription: `All ${category.name} articles`,
};

export async function getStaticProps() {
    // Run API calls in parallel
    const [articles, categories, homepage, global, landingpage, writers] = await Promise.all([
      fetchAPI("/articles?status=published"),
      fetchAPI("/categories"),
      fetchAPI("/homepage"),
      fetchAPI("/global"),
      fetchAPI("/landing-page"),
      fetchAPI("/writers")
    ]);


  
    return {
      props: { articles, categories, homepage, global, landingpage, writers },
      revalidate: 1,
    };
  }
  
  export default Landingpage;
